def isInMap(x,y):
    if x<0 or x >= len(fil) or y <0 or y>=len(fil[0]):
        return False
    return True

def getNeigh(x,y):
    neigh = []
    if isInMap(x-1, y):
        neigh.append([x-1, y])
    
    if isInMap(x, y-1):
        neigh.append([x,y-1])
    
    if isInMap(x, y+1):
        neigh.append([x,y+1])
    
    if isInMap(x+1, y):
        neigh.append([x+1,y])

    return neigh

def isLowPoint(x,y):
    neigh = getNeigh(x,y)
    #print(str(neigh))
    for n in neigh:
        if n <= fil[x][y]:
            return False
    return True

