basinN = 0
def compBasins(x,y):
    global fil

    fil[x][y]['basin'] = basinN
    neigh = getNeigh(x,y)
    area = 0
    for n in neigh:
        if fil[n[0]][n[1]]['n'] != 9 and fil[n[0]][n[1]]['basin']==-1:
            area = area + compBasins(n[0],n[1])
    return area + 1

